prompt Creating ACTIVITY...
create table ACTIVITY
(
  activityid      NUMBER(3) not null,
  act_description VARCHAR2(100) default 'No description provided',
  activity_name   VARCHAR2(100),
  guide_name      VARCHAR2(20),
  guide_phone     VARCHAR2(15)
)
tablespace SYSTEM
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table ACTIVITY
  add primary key (ACTIVITYID)
  using index 
  tablespace SYSTEM
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );

